- uid: azure-cognitiveservices-customsearch.WebPage.deepLinks
  name: deepLinks
  fullName: deepLinks
  children: []
  langs:
  - typeScript
  type: property
  summary: >-
    Una lista de vínculos al contenido relacionado que Bing se encuentra en el sitio Web que contiene esta página Web.

    El objeto de la página Web en este contexto incluye sólo el nombre, dirección url, urlPingSuffix y campos del fragmento de código.
  optional: true
  syntax:
    content: 'deepLinks?: WebPage[]'
    return:
      type:
      - azure-cognitiveservices-customsearch.WebPage[]
  package: azure-cognitiveservices-customsearch
