- uid: azure-cognitiveservices-customsearch.WebPage.searchTags
  name: searchTags
  fullName: searchTags
  children: []
  langs:
  - typeScript
  type: property
  summary: >-
    Una lista de etiquetas de búsqueda que el propietario de la página Web especificado en la página Web. La API devuelve sólo las etiquetas de búsqueda indizada. El campo nombre del objeto metaetiqueta contiene la etiqueta a la búsqueda por índice.

    Buscar etiquetas comienzan con search.* (por ejemplo, search.assetId). El campo de contenido contiene el valor de la etiqueta.
  optional: true
  syntax:
    content: 'searchTags?: WebMetaTag[]'
    return:
      type:
      - azure-cognitiveservices-customsearch.WebMetaTag[]
  package: azure-cognitiveservices-customsearch
